import React from 'react'

const Header = () => {
    return (
        <div className="ui menu">
            <div className="header item">
            Header
            </div>

            <button className="ui item primary button">Login</button>
            <button className="ui item button green">Sign Up</button>
        </div>
    )
}

export default Header;
